import Project from './Project';
import './style.css';

function Work() {

   const porefection = {
      title: 'Porefect Skincare',
      mockupPath: '/assets/work/porefection/desktop-mockup.png',
      deployedLink: 'https://porefect.herokuapp.com',
      repoLink: 'https://github.com/jittel/combo-skincare',
      team: [
         {
            name: 'Isis Alexander',
            role: 'Project Manager'
         },
         {
            name: 'Nate Ginn',
            role: 'Git Admin'
         },
         {
            name: 'Eli Wood',
            role: ''
         },
         {
            name: 'Jaden Storey',
            role: ''
         }
      ],
      tools: [
         'HTML',
         'CSS',
         'Javascript',
         'node.js',
         'Express.js',
         'MySQL 2',
         'Sequelize',
         'bcrypt',
         'Cloudinary'
      ],
      time: '1 Week',
      description: `For people that have too many skin products and aren’t quite sure about the order that they should use them in. Can make a profile, add a profile pic, and upload products, the site takes in a user’s products and puts them in the order that they should be using them.`,
      why: `For people that have too many skin products and aren’t quite sure about the order that they should use them in. Can make a profile, add a profile pic, and upload products, the site takes in a user’s products and puts them in the order that they should be using them.`,
      how: `Logging in gives you the ability to go to the profile page, which is where most of the app's functionality exists. You can add a picture to your profile, and add various skincare products to your page, which get auto populated in the order they should be used in.`
   }

   const recipeGenerator = {
      title: 'Recipe Generator',
      mockupPath: '/assets/work/recipe/desktop-mockup.png',
      deployedLink: 'https://mreliwood.github.io/demo-recipe-generator/',
      repoLink: 'https://github.com/MrEliWood/demo-recipe-generator',
      team: [
         {
            name: 'Eli Wood',
            role: 'Project Manager'
         },
         {
            name: 'Hannah Callison',
            role: 'Git Admin'
         },
         {
            name: 'Joe Choe',
            role: ''
         },
         {
            name: 'Jonathan Tran',
            role: ''
         }
      ],
      tools: [
         'HTML',
         'CSS',
         'Javascript',
         'jQuery',
         'TheMealDB API',
         'TheCocktailDB API'
      ],
      time: '1 Week',
      description: `For people that have too many skin products and aren’t quite sure about the order that they should use them in. Can make a profile, add a profile pic, and upload products, the site takes in a user’s products and puts them in the order that they should be using them.`,
      why: `For people that have too many skin products and aren’t quite sure about the order that they should use them in. Can make a profile, add a profile pic, and upload products, the site takes in a user’s products and puts them in the order that they should be using them.`,
      how: `Logging in gives you the ability to go to the profile page, which is where most of the app's functionality exists. You can add a picture to your profile, and add various skincare products to your page, which get auto populated in the order they should be used in.`
   }

   return (
      <div className="page">
         <Project project={porefection} />
      </div>
   );

}

export default Work;
